script: |
  super -f text -I q1032.spq | sort > q1032.out

inputs:
  - name: q1032.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + 35 + 73 * - col2 + - col1 + col1 / + 19 NOT BETWEEN + col2 + - - 1 AND + - 33;
  - name: tab1

outputs:
  - name: q1032.out
    data: |
      51	14	96
      85	5	59
      91	47	68
